def sort_complex_numbers(numbers):
    real_freq = {}
    for num in numbers:
        if num.real not in real_freq:
            real_freq[num.real] += 1
        else:
            real_freq[num.real] = 1
    numbers.sort(key=lambda num: (-real_freq[num.real], -abs(num.imag)))
    return numbers

